function Article(props) {
  const article = props.articleData;

  return (
    <div>
      {article ? (
        <>
          <h1>{article.title}</h1>
          <p>{article.subtitle}</p>
        </>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
}
